求解
解法：

首先合并两个数组
接着对数组进行排序
找到中位数
若数组个数为偶数，则找到中间位两位的前一位的下标，从而找到下一个下标，若为奇数，则直接找到中位数
从而计算出最终的结果

/**
 * @param {number[]} nums1
 * @param {number[]} nums2
 * @return {number}
 */
var findMedianSortedArrays = function(nums1, nums2) {
    var arr = nums1.concat(nums2);
    arr.sort((a, b) => a - b);
    var len = arr.length;
    var midIndex = Math.ceil(len / 2);
    var mid;
    if (len % 2 === 0) {
        mid = (arr[midIndex - 1] + arr[midIndex]) / 2;
    } else {
        mid = arr[midIndex - 1];
    }
    return mid;
};

